// ==UserScript==
// @name         GrepoBot Updated
// @namespace    local.grepobot
// @version      0.1.0
// @description  Local bundle for GrepoBot Updated
// @match        https://*.grepolis.com/game/*
// @exclude      https://classic.grepolis.com/game/*
// @grant        none
// ==/UserScript==

const GREPOBOT_BUNDLE = {
  "I18n.en.js": "",
  "I18n.fr.js": "",
  "GrepoBotUpdated.js": "",
  "ConsoleLog.js": "",
  "DataExchanger.js": "",
  "FormBuilder.js": "",
  "ModuleManager.js": "",
  "Assistant.js": "",
  "Redirect.js": "",
  "Autofarm.js": "",
  "Autoculture.js": "",
  "Autobuild.js": "",
  "Autoattack.js": "",
};
const GREPOBOT_CSS_B64 = "";

function grepobotDecodeBinary(b64) {
  return atob(b64);
}

function grepobotDecodeUtf8(b64) {
  const binary = atob(b64);
  if (typeof TextDecoder !== "undefined") {
    const bytes = new Uint8Array(binary.length);
    for (let i = 0; i < binary.length; i++) {
      bytes[i] = binary.charCodeAt(i);
    }
    return new TextDecoder("utf-8").decode(bytes);
  }
  return decodeURIComponent(escape(binary));
}

function grepobotInjectScript(code) {
  const script = document.createElement("script");
  script.textContent = code;
  document.documentElement.appendChild(script);
  script.remove();
}

function grepobotRunScript(name) {
  const b64 = GREPOBOT_BUNDLE[name];
  if (!b64) {
    throw new Error("Missing script in bundle: " + name);
  }
  const code = grepobotDecodeUtf8(b64);
  grepobotInjectScript(code);
}

function grepobotInjectCss() {
  if (document.getElementById("grepobot-local-css")) {
    return;
  }
  const style = document.createElement("style");
  style.id = "grepobot-local-css";
  style.textContent = grepobotDecodeBinary(GREPOBOT_CSS_B64);
  document.head.appendChild(style);
}

function grepobotParseAjaxOptions(args) {
  if (!args.length) {
    return null;
  }
  const first = args[0];
  if (typeof first === "string") {
    const opts = args[1] ? Object.assign({}, args[1]) : {};
    opts.url = first;
    return opts;
  }
  if (first && typeof first === "object") {
    return first;
  }
  return null;
}

function grepobotBundleNameFromUrl(url) {
  if (!url) {
    return null;
  }
  const last = url.split("/").pop();
  return last ? last.split("?")[0] : null;
}

function grepobotInstallAjaxHook() {
  if (!window.jQuery || window.__grepobot_ajax_hooked) {
    return;
  }
  const $ = window.jQuery;
  const originalAjax = $.ajax;

  $.ajax = function () {
    const options = grepobotParseAjaxOptions(arguments);
    if (options && options.dataType) {
      const dataType = String(options.dataType).toLowerCase();
      if (dataType === "script") {
        const name = grepobotBundleNameFromUrl(options.url);
        if (name && GREPOBOT_BUNDLE[name]) {
          const d = $.Deferred();
          try {
            grepobotRunScript(name);
            if (typeof options.success === "function") {
              options.success();
            }
            if (typeof options.complete === "function") {
              options.complete();
            }
            d.resolve();
          } catch (err) {
            console.error("[Grepolis] Script load failed:", name, err);
            if (typeof options.error === "function") {
              options.error(err);
            }
            if (typeof options.complete === "function") {
              options.complete();
            }
            d.reject(err);
          }
          return d;
        }
      }
    }
    return originalAjax.apply(this, arguments);
  };

  window.__grepobot_ajax_hooked = true;
}

function grepobotWaitForReady() {
  const timer = setInterval(function () {
    if (window.__grepobot_local_loaded) {
      clearInterval(timer);
      return;
    }
    if (!document.head || !window.jQuery) {
      return;
    }
    window.__grepobot_local_loaded = true;
    grepobotInstallAjaxHook();
    grepobotInjectCss();
    grepobotRunScript("GrepoBotUpdated.js");
  }, 250);
}

grepobotWaitForReady();
